import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
// import App from "./App";
import reportWebVitals from "./reportWebVitals";

const Hello = () => {
	return (
		<div>
			<p>Hello world</p>
		</div>
	);
};

const App = () => {
	return (
		<div>
			<h1>Greetings</h1>
			<Hello />
		</div>
	);
};

ReactDOM.render(
	<React.StrictMode>
		<App />
	</React.StrictMode>,
	document.getElementById("root")
);

// If you want to start measuring performance in your app, pass a function
